    false,nt"url": null,nt"notes": "The U.S. Geological Survey (USGS) - Upper
    Midwest Environmental Sciences Center (UMESC) has produced a high-resolution land
    cover/land use (LCU) spatial database of Neal Smith National Wildlife Refuge (NSNWR).
    The LCU data were interpreted from 2006 color-infrared (CIR) aerial photographs
    collected on August 15th at a scale of 1:10,000. Vegetation types were classified
    with refuge-derived classes that best described current vegetation in an dynamic
    ecosystem (primarily agricultural fields being converted back to prairie). The photos
    were interpreted using a minimum mapping unit of 1-hectare and a 10% minimum vegetation
    cover. The photos were interpreted to delineate land cover/land use, percent vegetation
    cover, and tree height. The geographic extent of the NSNWR LCU database encompasses
    10,436 acres of cool and warm season grasses, oak savannah, volunteer forests, pasture,
    and agriculture in Jasper County, Iowa.",nt"license_title": "License Not Specified",nt"extras":
